import React from "react";
import "./contact.scss";
import { LinkedIn, Mail } from "@material-ui/icons";

function Contact() {
  return (
    <div className="contact" id="contact">
      <div className="left">
        <img src="src/img/backdrop.png" alt="" />
      </div>
      <div className="right">
        <h2>Contact</h2>
        <div className="itemContainer">
          <Mail className="icon" />
          <span>sintha.sinurat@gmail.com</span>
        </div>
        <div className="itemContainer">
          <LinkedIn className="icon" />
          <span>https://www.linkedin.com/in/sinthads/</span>
        </div>
      </div>
    </div>
  );
}

export default Contact;
